import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { ButtonModule } from 'primeng/button';
import { CalendarModule } from 'primeng/calendar';
import { CardModule } from 'primeng/card';
import { CheckboxModule } from 'primeng/checkbox';
import { DialogModule } from 'primeng/dialog';
import { DividerModule } from 'primeng/divider';
import { InputTextModule } from 'primeng/inputtext';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { PanelModule } from 'primeng/panel';
import { SelectButtonModule } from 'primeng/selectbutton';
import { TableModule } from 'primeng/table';
import { TabViewModule } from 'primeng/tabview';
import { ToggleButtonModule } from 'primeng/togglebutton';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { EnquiryNsmanModule } from '../nsman/enquiry-nsman.module';
import { CABModule } from '../caution-alert-block/cab.module';

import { EnquiryCompanyComponent } from './enquiry-company.component';
import { EnquiryCompanyRoutingModule } from './route/enquiry-company-routing.module';
import { CompanyParticularsSummaryComponent } from './company-particulars/company-particulars-summary.component';
import { CompanyExpandedDetailsComponent } from './company-particulars/expanded-details/company-expanded-details.component';
import { CompanyPartialCsnSearchComponent } from './search/partial-csn/company-partial-csn-search.component';
import { CompanyTabsComponent } from './search/company-tabs/company-tabs.component';
import { CompanyClaimTabComponent } from './search/company-tabs/claim-tab/company-claim-tab.component';
import { CompanyPaymentTabComponent } from './search/company-tabs/payment-tab/company-payment-tab.component';
import { CompanyPrePopulatedEclaimTabComponent } from './search/company-tabs/pre-populated-eclaim-tab/company-pre-populated-eclaim-tab.component';
import { CompanyOverpaymentTabComponent } from './search/company-tabs/overpayment-tab/company-overpayment-tab.component';
import { CompanyOPPaymentTransactionHistoryComponent } from './search/company-tabs/overpayment-tab/payment-transaction-history/company-op-payment-transaction-history.component';
import { CompanySupportingDocumentTabComponent } from './search/company-tabs/supporting-document-tab/company-supporting-document-tab.component';
import { CompanyLetterTabComponent } from './search/company-tabs/letter-tab/company-letter-tab.component';


@NgModule({
  declarations: [
    EnquiryCompanyComponent,
    CompanyParticularsSummaryComponent,
    CompanyExpandedDetailsComponent,
    CompanyPartialCsnSearchComponent,
    CompanyTabsComponent,
    CompanyClaimTabComponent,
    CompanyPaymentTabComponent,
    CompanyPrePopulatedEclaimTabComponent,
    CompanyOverpaymentTabComponent,
    CompanyOPPaymentTransactionHistoryComponent,
    CompanySupportingDocumentTabComponent,
    CompanyLetterTabComponent
  ],
  imports: [
    CommonModule,
    SharedModule,
    ButtonModule,
    CalendarModule,
    CardModule,
    CheckboxModule,
    DialogModule,
    DividerModule,
    FormsModule,
    InputTextModule,
    InputTextareaModule,
    PanelModule,
    ReactiveFormsModule,
    SelectButtonModule,
    TableModule,
    TabViewModule,
    ToggleButtonModule,
    EnquiryCompanyRoutingModule,
    CABModule,
  ],
  exports: [],
  providers: []
})
export class EnquiryCompanyModule { }
